  5,\n\t\"tags\": [],\n\t\"title\": \"AFSC/RACE/EcoFOCI - Chlorophyll, temperature,
  salinity, nutrients, chlorophyll, fluorescence and zooplankton collected around
  the moorings and along the 70-m isobath on 4 cruises (3MF07, 18 April - 6 May; 1HE07,
  10 April - 12 May; 7MF07, 17 - 30 September; 1TT07, 24 September - 11 October\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-05-31T01:06:01.567003\",\n\t\"name\": \"afsc-race-ecofoci-chlorophyll-temperature-salinity-nutrients-chlorophyll-fluorescence-and-zoop\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data are part of an ocean observation
  study by Stabeno, Napp, and Whitledge sponsored, in part, by the North Pacific Research
  Board (Project 701; http://doc.nprb.org).  The grant was titled \"Sentinels for
  ecosystem change: long term biophysical moorings on the Bering Sea shelf (2007 b??
  2008).\"  Moorings have been maintained on the southeastern Bering Sea shelf at
  four sites: M2 (56.9B0N, 164.1B0W) since 1995, M4 (57.9B0N, 168.9B0W) since 1996;
  M5 (59.9B0N, 171.7B0W) and; M8 (62.2B0N 174.7B0W) since 2004. Shipboard measurements
  of temperature, salinity, nutrients, chlorophyll, fluorescence and zooplankton were
  collected around the moorings and along the 70-m isobath on 4 cruises (3MF07, 18
  April b?? 6 May; 1HE07, 10 April b?? 12 May; 7MF07, 17 b?? 30 September; 1TT07,
  24 September b?? 11 October) to groundtruth the in situ sensors on the moorings
  and to learn the factors that distinguish the upper water column of the central
  and southeastern middle shelf.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
